% PHreal1.m: Used by the PG to determine the pulse amplitude% This is a simple example of how to use an m-file from within SIMULINK  % Written by:  Jonathan Jacobs%              May 1998 - June 1998 (last mod: 06/01/98)function y = PHreal1( u )coeff(1) = 3.378114792e-008;coeff(2) = -6.425704573e-006;coeff(3) = 0.0004956972413;coeff(4) = -0.01995916568;coeff(5) = 0.4502060154;coeff(6) = -5.67235726;coeff(7) = 37.44694284;coeff(8) = 4.861756779;numCo = length(coeff);y = 0;for i = 1:numCo   y = y + (coeff(i) * abs(u)^(numCo-i));endif (abs(u)>50)   y=105.8105;endy=y*sign(u);